// Abrir modal
cy.get('button[onclick="abrirModalCrearCotizacion()"]').click();
cy.get("#modalCrearCotizacion").should("be.visible");
// Seleccionar cliente
cy.get('#modalCrearCotizacion input[name="cliente"]').clear().type(escenario.cliente);
// Llenar campos restantes
cy.get('#modalCrearCotizacion input[name="descripcion"]').clear().type(escenario.descripcion);
// -- codigo del producto --
cy.get("#modalCrearCotizacion .cotizacion-select-input").click();
cy.get(`#modalCrearCotizacion .cotizacion-select-option[data-codigo="${escenario.producto}"]`).click({
  force: true
});
cy.get('#modalCrearCotizacion input[name="productosCotizacion[1][descripcion]"]').clear().type(escenario.productoDescripcion);
cy.get('#modalCrearCotizacion input[name="productosCotizacion[1][cantidad]"]').clear().type(escenario.cantidad);
cy.get('#modalCrearCotizacion input[name="productosCotizacion[1][descuento]"]').clear().type(escenario.descuento);
cy.get('#modalCrearCotizacion select[name="productosCotizacion[1][iva]"]').select(escenario.iva);
// Guardar / Cerrar modal
cy.get("#modalCrearCotizacion div.modal-footer.bg-light").find("button.btn.btn-success").click();
// Esperar y cerrar SweetAlert2 usando el botón "Entendido"
cy.get(".swal2-container", {
  timeout: 10000
}).should("not.be.visible");
// Validar que la cotización aparece en la tabla
cy.get(".table-cotizaciones") // tabla donde se listan las cotizaciones
.find("span.badge.badge-light.border.font-weight-semibold.text-primary").last() // tomar la última cotización creada
.invoke("text").then(codigo => {
  // Validar que la tabla contiene ese código
  cy.get(".table-cotizaciones").should("contain.text", codigo);
});

